import React from 'react';
import Youtube from 'react-youtube';
import { useYoutubeDataLayerValue } from '../../contexts/YoutubeDataLayer';
import "./styles/LatestVideo.css"; 

function LatestVideo({}) {
  const [{channel, latest_video}, youtubeDispatch] = useYoutubeDataLayerValue();

  const playerOnReady = (event) => {

    event.target.pauseVideo();
  }

  const opts = {
    height: '390',
    width: '640',
    playerVars: {
      autoplay: 1,
    }
  }


  return (
    <div className="latestvideo__body">
      Latest Video
      <p>{latest_video?.contentDetails?.videoId}</p>
      <Youtube 
        videoId={latest_video?.contentDetails.videoId}
        opts={opts}
        onReady={playerOnReady}
      />
    </div>
  )
}

export default LatestVideo;
